import { BrowserRouter,Router,Route } from 'react-router-dom'
import Home from './pages/Home'
function App() {
  return (
    <div className='home'>
      <BrowserRouter>
        <Router>
          <Route path="/" 
          element={<Home />} 
          />
        </Router>
      </BrowserRouter>
    </div>
  )
}

export default App
